import { BrowserRouter as Router, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Route path="/">
      <div className="App">
      <h1>Dictionary</h1>
    </div>
      </Route>
    </Router>

  );
}

export default App;
